import React from 'react';
import LoginButton from './LoginButton';
import Pricing from './Pricing';

export default function MainNav() {
    return (
        <>
            <img src=""  alt="" />
            <h1>Formidable</h1>
            <div>
                <Link to="/pricing"></Link><p>Pricing</p>
                <LoginButton />
            </div>
        </>
    )
}
